import React, { useState, useEffect } from 'react';
import { customerAPI } from '../services/api';

const CustomerList = () => {
  const [customers, setCustomers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  const fetchCustomers = async () => {
    try {
      setError('');
      console.log('üîÑ Fetching customers...');
      const response = await customerAPI.getAllCustomers();
      console.log('‚úÖ Customers fetched:', response.data.customers);
      setCustomers(response.data.customers || []);
    } catch (err) {
      console.error('‚ùå Error fetching customers:', err);
      setError('Failed to load customers. Please check if backend is running.');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchCustomers();
  }, []);

  if (loading) {
    return (
      <div className="card">
        <div className="loading">
          <div className="loading-spinner"></div>
          Loading customers...
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="card">
        <div className="alert alert-error">
          ‚ùå {error}
        </div>
        <button onClick={fetchCustomers} className="btn btn-primary">
          üîÑ Retry
        </button>
      </div>
    );
  }

  return (
    <div className="card">
      <div className="card-header">
        <h2 className="card-title">üìã Customer List</h2>
        <button 
          onClick={fetchCustomers}
          className="btn btn-outline"
          disabled={loading}
        >
          üîÑ Refresh
        </button>
      </div>

      {customers.length === 0 ? (
        <div className="empty-state">
          <div className="empty-state-icon">üë•</div>
          <h3>No customers found</h3>
          <p>Add your first customer to get started</p>
        </div>
      ) : (
        <div className="table-container">
          <table className="table">
            <thead>
              <tr>
                <th>ID</th>
                <th>Name</th>
                <th>Phone</th>
                <th>Email</th>
                <th>Address</th>
                <th>Joined Date</th>
              </tr>
            </thead>
            <tbody>
              {customers.map((customer) => (
                <tr key={customer.id}>
                  <td>{customer.id}</td>
                  <td>
                    <strong>{customer.name}</strong>
                  </td>
                  <td>{customer.phone}</td>
                  <td>{customer.email || 'N/A'}</td>
                  <td style={{ maxWidth: '200px', overflow: 'hidden', textOverflow: 'ellipsis', whiteSpace: 'nowrap' }}>
                    {customer.address}
                  </td>
                  <td>{new Date(customer.created_at).toLocaleDateString()}</td>
                </tr>
              ))}
            </tbody>
          </table>
          <div style={{ padding: '1rem', textAlign: 'center', color: 'var(--gray-600)', fontSize: '0.875rem' }}>
            Showing {customers.length} customer{customers.length !== 1 ? 's' : ''}
          </div>
        </div>
      )}
    </div>
  );
};

export default CustomerList;
